import React from "react";
import RouterPage from "./comp/route/router";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Navbar from "./comp/navbar";
import Footer from "./comp/footer";
function App() {
  return (
    <>
      <Router>
        <Navbar />
        <Switch>
          <RouterPage />
        </Switch>
        <Footer />
      </Router>
    </>
  );
}

export default App;
